import React from 'react';
import './Home.css'

function Home() {
  return (
    <div class="container">
      <div class="header">
        <h1><a href="home.html">WTN</a></h1>
      </div>
      <div class="adg_info">
        <h2>Automatic<br/>Document Generator</h2>
        <p>Upload a file that you want to make a document automatically</p>
        <a href="login.html"><button>Get Started</button></a>
      </div>
    </div>
  );
}

export default Home;
